<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>SPECS Nexus Homepage</title>
    <style>
        body {
            background-color: rgb(56, 77, 55);
            margin: 0;
            overflow-x: hidden;
            overflow-y: hidden; 
        }
        .container {
            position: relative;
            width: 100vw;
            height: 100vh;
        }
        .circle {
            width: 1105px;
            height: 1105px;
            background-color: #ffffffd7;
            border-radius: 50%;
            position: absolute;
            right: -200px; 
            bottom: 320px; 
            object-fit: cover;
        }
        .Logo {
            position: absolute;
            top: 41.5%;
            left: 44%;
            transform: translate(-50%, -50%); 
            height: auto;
            object-fit: cover;
        }
        header {
            display: flex;
            justify-content: space-between; 
            align-items: center;
            padding: 10px 20px;
        }
        footer {
            position: fixed;
            bottom: 35px;
            right: 40px;
            display: flex;
            align-items: center;
            padding: 10px 20px;
        }
        .login-btn {
            padding: 10px 30px;
            font-size: 20px;
            font-weight: bold;
            color: white;
            background-color: rgb(75, 75, 75);
            border: none;
            border-radius: 20px;
            cursor: pointer;
            transition: background-color 0.3s;
            display: flex;
            align-items: center;
            gap: 10px;
        }
        .Login-logo {
            width: 20px;
            height: auto;
        }
        .login-btn:hover {
            background-color: rgb(34, 60, 32);
        }
        .GC-logo {
            width: 100px;
            height: auto;
            margin-top: 460px;
            margin-left: 70px;
        }
        .CCS-logo {
            width: 100px;
            height: auto;
            margin-top: 460px;
        }
        .content-dir-item {
            display: flex;
            align-items: center;
            gap: 10px;
        }
        .SPECS-Nexus {
            position: absolute;
            left: 120px;
            top: 70px;
        }
        h2 {
            color:rgb(69, 69, 69);
            font-family: "Russo One", sans-serif;
            font-weight: 1000;
            font-size: 220%;
        }
        .SPECS-logo {
            width: 100px;
            height: auto;
            margin-top: 40px;
            margin-left: 40px;
        }
        .popup-overlay {
            display: none; 
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.5);
            backdrop-filter: blur(5px);
            justify-content: center;
            align-items: center;
        }
        .popup-content {
            background: white;
            padding: 20px;
            width: 310px;
            border-radius: 17px;
            box-shadow: 0 2px 10px rgba(97, 97, 97, 0.315);
            text-align: center;
            position: relative;
            animation: fadeIn 0.5s;
        }
        .close-btn {
            position: absolute;
            top: 10px;
            right: 15px;
            font-size: 20px;
            cursor: pointer;
            color: gray;
        }
        .close-btn:hover {
            color: rgb(44, 44, 44);
        }
        .popup-content input {
            width: 80%;
            padding: 12px;
            margin: 15px 0;
            font-weight: bold;
            font-size: large;
            border: 1px solid #ccc;
            border-radius: 10px;
        }
        .popup-content button {
            width: 40%;
            padding: 10px;
            background: rgb(42, 75, 40);
            color: white;
            font-size: 18px;
            font-weight: bolder;
            border: none;
            border-radius: 20px;
            cursor: pointer;
            margin-top: 15px;
            margin-bottom: 20px;
        }
        .popup-content button:hover {
            background: rgb(34, 60, 32);
        }
        @keyframes fadeIn {
            from {
                opacity: 0;
                transform: scale(0.9);
            }
            to {
                opacity: 1;
                transform: scale(1);
            }
        }

        .SPECS-acronym {
            position: absolute;
            width: 355px;
            height: 505px;
            left: 90px;
            top: 100px;
        }
    </style>
</head>
